import { isResSent } from 'next/dist/next-server/lib/utils';

const Users = ({ users }) => {
  console.log('USERS', users);
  return (
    <ul className="list-group">
      {users.map((user) => (
        <li className="list-group-item list-group-item-action">
          <h5>{user.first_name}</h5>
          <p>{user.email}</p>
        </li>
      ))}
    </ul>
  );
};

export default Users;
